import React, { useState } from "react";

import Grid from "@mui/material/Grid";
import Stack from "@mui/material/Stack";
import { styled } from "@mui/material/styles";
import Paper from "@mui/material/Paper";
import "./Navbar.css";

import Box from "@mui/material/Box";
import SwipeableDrawer from "@mui/material/SwipeableDrawer";
import Button from "@mui/material/Button";
import List from "@mui/material/List";
import Divider from "@mui/material/Divider";
import ListItem from "@mui/material/ListItem";
import ListItemButton from "@mui/material/ListItemButton";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import InboxIcon from "@mui/icons-material/MoveToInbox";
import MailIcon from "@mui/icons-material/Mail";

import insta_logo from "../../images/logoinsta.png";
import home from "../../images/home.svg";
import message from "../../images/message.svg";
import find from "../../images/find.svg";
import love from "../../images/love.svg";

export default function NavBar() {
  return (
    <div className="left-navigation-bar">
      <div className="insta_name">
        <img className="navbar_logo" src={insta_logo} width="105px" />
      </div>

      <div className="navOption">
        <List>
          <ListItem>
            <ListItemButton sx={{width: '200px', 
          height: '50px',
          borderRadius: '8px'}}>
              <div className="nav-button">

                <img src={home} width="25px" />
                <span style={{font}}>Home</span>
              </div>
            </ListItemButton>
          </ListItem>

          <ListItem>
            <ListItemButton>fdsfadfsd</ListItemButton>
          </ListItem>
        </List>
      </div>

      <div className="navMore">fdfd</div>
    </div>
  );
}
